import React, { Component } from 'react'
import PropTypes from 'prop-types'

export default class Comments extends Component {
    static propTypes = {
        prop: PropTypes
    }

    render() {
        const key = Object.keys(this.props.Comments)
        return (
            <div>
            {key.map( key => 
                <Comments c={this.props.Comments[key]}/>
                )}
           </div>
        )
    }
}
